        display: 'flex', 
        justifyContent: 'space-around', 
        paddingLeft: 810, 
        paddingRight: 810
    },

    headingStyle : {
        textAlign: 'center', 
        fontFamily: 'Helvetica, sans-serif', 
        fontStyle: 'oblique', 
        color: 'black', 
        fontSize: '68px'
